import React, { useState } from "react";
import { Link, NavLink } from "react-router-dom";

export default function ToggleNavbar() {
  const [active, setActive] = useState("false");

  const handleToggle = () => {
    setActive(!active);
  };

  return (
    <div>
      <nav className="navbar">
        <i
          onClick={handleToggle}
          className={`fas fa-bars hamburger ${
            active ? "toggleMenu-active" : ""
          }`}
        ></i>
        <div className="toggleMenu">
          <ul>
            <li className="logIn">
              <NavLink to="/Login">Log-In</NavLink>
            </li>
            <li className="myList">
              <NavLink to="/#"> My List</NavLink>
            </li>
            <li className="posting">
              <NavLink to="/Gallery"> Post My Tri</NavLink>
            </li>
            <li className="singIn">
              <NavLink to="/Joinus" activeStyle>
                {" "}
                Sing-In
              </NavLink>
            </li>
          </ul>
        </div>

        <div>
          <Link className="title" to="/">
            Go Travel
          </Link>
        </div>

        <i className="fas fa-search"></i>
      </nav>
    </div>
  );
}

